<!doctype html>
<html lang="en">

<head>
  <meta charset="utf-8">
  <meta http-equiv="x-ua-compatible" content="ie=edge">
  <title>Front-End Library</title>
  <meta name="format-detection" content="telephone=no" />
  <meta name="theme-color" content="#000000">
  <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no">
  <link rel="stylesheet" href="/static/css/all.css">
  <script>
    (function (d, w) {
      if (!('devicePixelRatio' in w)) return;

      d.documentElement.className += ' has-js';

      function loadInOrder(src) {
        var s = d.createElement('script');
        var deps = [].slice.call(arguments).slice(1);
        s.src = src;
        s.onload = function () { deps.length && loadInOrder.apply(null, deps); };
        s.onerror = console.error;
        d.head.appendChild(s);
      }

      var supported =
        'Symbol' in w &&
        'Promise' in w &&
        'assign' in Object &&
        'from' in Array &&
        Symbol.iterator in NodeList.prototype &&
        Symbol.iterator in HTMLCollection.prototype;

      if (supported) {
        loadInOrder('/static/js/main.js');
      } else {
        loadInOrder('/static/js/polyfill.js', '/static/js/main.js');
      }

    }(document, window));
  </script>
</head>

<body class=wrapper data-module="Toggle/toggle">
    <header class="page-header" data-module="ui/Router">
    <button class="menu-toggle" data-module="menu-button/menu-button" data-opened="false"></button>



    <nav class="page-header-links hidden">

                <li><a class="link" href="/category/business">Business</a></li>
            
                <li><a class="link" href="/category/entertainment">Entertainment</a></li>
            
                <li><a class="link" href="/category/sport">Sport</a></li>
            
                <li><a class="link" href="/category/health">Health</a></li>
            
                <li><a class="link" href="/category/technology">Technology</a></li>
            
        </ul>
    </nav>
</header>


    <main class="main" data-module="ui/MouseMove">
        <div class="error">
            <div class="container">
                <div class="eye"></div>
                <div class="eye"></div>
                <div class="info-error">
                    <h1>Page Not Found</h1>
                    <p>Sorry, but the page you were trying to view does not exist.</p>
                    <code>
                        
                        
                    </code>
                </div>
            </div>
        </div>
    </main>
</body>

</html>
